import React from "react";

const HeaderMenu = () => {
  return (
    <div className="flex justify-center gap-8 py-2 bg-primary dark:bg-nba-blue">
      <button className="px-6 py-2 text-primary bg-nba-orange darkrounded hover:bg-nba-red">
        Orçamentos
      </button>
      <button className="px-6 py-2 text-primary bg-nba-orange rounded hover:bg-nba-red">
        Produtos
      </button>
      <button className="px-6 py-2 text-primary bg-nba-orange rounded hover:bg-nba-red">
        Usuários
      </button>
      <button className="px-6 py-2 text-primary bg-nba-orange rounded hover:bg-nba-red">
        Lojas
      </button>
    </div>
  );
};

export default HeaderMenu;
